    return (
        <div>
            <h1 onClick={(e) => console.log('click', e)}>
                Hello world!!
            </h1>
            {array1.map(element => <p>{element}</p>)}
            <Button onClick={() => console.log('click')}>
                Send
            </Button>
        </div>
    );
};

export default App
